import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import { 
  ArrowRight, 
  Code, 
  Cpu, 
  Shield, 
  Wifi, 
  Trophy,
  Calendar,
  Users,
  Zap,
  Terminal,
  GitBranch,
  Database,
  ChevronDown,
  Play,
  Sparkles
} from 'lucide-react';
import { CLUB_INFO, DOMAINS } from '../utils/constants';

const Home = () => {
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });

  useEffect(() => {
    const handleMouseMove = (e) => {
      setMousePosition({ x: e.clientX, y: e.clientY });
    };
    window.addEventListener('mousemove', handleMouseMove);
    return () => window.removeEventListener('mousemove', handleMouseMove);
  }, []);

  const techStack = [
    { name: 'Machine Learning', icon: Cpu, color: 'from-purple-500 to-pink-500' },
    { name: 'IoT', icon: Wifi, color: 'from-green-500 to-emerald-500' },
    { name: 'Blockchain', icon: Database, color: 'from-yellow-500 to-orange-500' },
    { name: 'Cyber Security', icon: Shield, color: 'from-red-500 to-rose-500' }
  ];

  const stats = [
    { number: '500+', label: 'Members', Icon: Users, delay: 0 },
    { number: '50+', label: 'Projects', Icon: GitBranch, delay: 0.1 },
    { number: '25+', label: 'Hackathons', Icon: Trophy, delay: 0.2 },
    { number: '100+', label: 'Events', Icon: Calendar, delay: 0.3 }
  ];

  const codeLines = [
    'class MIBCS {',
    '  constructor() {',
    '    this.mission = "Innovation";',
    '    this.vision = "Future Tech";',
    '    this.members = 500+;',
    '  }',
    '}'
  ];

  return (
    <div className="min-h-screen bg-gray-950 overflow-hidden">
      {/* Animated cursor follower */}
      <div 
        className="fixed w-6 h-6 bg-cyan-400/20 rounded-full pointer-events-none z-50 mix-blend-difference"
        style={{
          left: mousePosition.x - 12,
          top: mousePosition.y - 12,
          transition: 'all 0.1s ease-out'
        }}
      />

      {/* Hero Section */}
      <section className="relative min-h-screen flex items-center justify-center overflow-hidden">
        {/* Animated Tech Background */}
        <div className="absolute inset-0">
          {/* Base gradient */}
          <div className="absolute inset-0 bg-gradient-to-br from-gray-950 via-gray-900 to-gray-950"></div>

          {/* Animated circuit lines */}
          <svg className="absolute inset-0 w-full h-full opacity-20" viewBox="0 0 1000 1000">
            <defs>
              <linearGradient id="circuit-gradient" x1="0%" y1="0%" x2="100%" y2="100%">
                <stop offset="0%" stopColor="#06b6d4" stopOpacity="0.8" />
                <stop offset="50%" stopColor="#3b82f6" stopOpacity="0.6" />
                <stop offset="100%" stopColor="#8b5cf6" stopOpacity="0.4" />
              </linearGradient>
            </defs>

            {/* Horizontal lines */}
            {[...Array(8)].map((_, i) => (
              <motion.line
                key={`h-${i}`}
                x1="0"
                y1={100 + i * 120}
                x2="1000"
                y2={100 + i * 120}
                stroke="url(#circuit-gradient)"
                strokeWidth="2"
                initial={{ pathLength: 0, opacity: 0 }}
                animate={{ pathLength: 1, opacity: 1 }}
                transition={{ duration: 2, delay: i * 0.2, repeat: Infinity, repeatType: "reverse", repeatDelay: 3 }}
              />
            ))}

            {/* Vertical lines */}
            {[...Array(6)].map((_, i) => (
              <motion.line
                key={`v-${i}`}
                x1={150 + i * 140}
                y1="0"
                x2={150 + i * 140}
                y2="1000"
                stroke="url(#circuit-gradient)"
                strokeWidth="2"
                initial={{ pathLength: 0, opacity: 0 }}
                animate={{ pathLength: 1, opacity: 1 }}
                transition={{ duration: 2.5, delay: i * 0.3, repeat: Infinity, repeatType: "reverse", repeatDelay: 4 }}
              />
            ))}

            {/* Circuit nodes */}
            {[...Array(20)].map((_, i) => (
              <motion.circle
                key={`node-${i}`}
                cx={150 + (i % 6) * 140}
                cy={100 + Math.floor(i / 6) * 120}
                r="4"
                fill="#06b6d4"
                initial={{ scale: 0, opacity: 0 }}
                animate={{ scale: [0, 1.5, 1], opacity: [0, 1, 0.7] }}
                transition={{ duration: 1, delay: i * 0.1, repeat: Infinity, repeatDelay: 5 }}
              />
            ))}
          </svg>

          {/* Floating geometric shapes */}
          {[...Array(15)].map((_, i) => (
            <motion.div
              key={`shape-${i}`}
              className="absolute"
              style={{
                left: `${Math.random() * 100}%`,
                top: `${Math.random() * 100}%`,
              }}
              initial={{ opacity: 0, scale: 0, rotate: 0 }}
              animate={{ 
                opacity: [0, 0.3, 0],
                scale: [0, 1, 0],
                rotate: 360,
                x: [0, Math.random() * 200 - 100],
                y: [0, Math.random() * 200 - 100]
              }}
              transition={{
                duration: Math.random() * 10 + 10,
                repeat: Infinity,
                delay: Math.random() * 5
              }}
            >
              <div className={`w-4 h-4 ${i % 3 === 0 ? 'bg-cyan-400' : i % 3 === 1 ? 'bg-blue-500' : 'bg-purple-500'} ${i % 2 === 0 ? 'rounded-full' : 'rotate-45'} opacity-30`} />
            </motion.div>
          ))}

          {/* Animated robot/AI elements */}
          <div className="absolute top-1/4 right-10 opacity-10">
            <motion.div
              animate={{ 
                rotate: [0, 360],
                scale: [1, 1.1, 1]
              }}
              transition={{ duration: 20, repeat: Infinity, ease: "linear" }}
              className="w-32 h-32"
            >
              <svg viewBox="0 0 100 100" className="w-full h-full">
                <circle cx="50" cy="50" r="45" fill="none" stroke="#06b6d4" strokeWidth="2" strokeDasharray="5,5" />
                <circle cx="50" cy="50" r="35" fill="none" stroke="#3b82f6" strokeWidth="1" strokeDasharray="3,3" />
                <circle cx="50" cy="50" r="25" fill="none" stroke="#8b5cf6" strokeWidth="1" strokeDasharray="2,2" />
                <circle cx="50" cy="50" r="3" fill="#06b6d4" />
              </svg>
            </motion.div>
          </div>

          <div className="absolute bottom-1/4 left-10 opacity-10">
            <motion.div
              animate={{ 
                rotate: [360, 0],
                scale: [1, 0.9, 1]
              }}
              transition={{ duration: 15, repeat: Infinity, ease: "linear" }}
              className="w-24 h-24"
            >
              <svg viewBox="0 0 100 100" className="w-full h-full">
                <polygon points="50,10 90,90 10,90" fill="none" stroke="#06b6d4" strokeWidth="2" strokeDasharray="4,4" />
                <polygon points="50,20 80,80 20,80" fill="none" stroke="#3b82f6" strokeWidth="1" strokeDasharray="2,2" />
                <circle cx="50" cy="60" r="2" fill="#06b6d4" />
              </svg>
            </motion.div>
          </div>
        </div>

        {/* Main Content */}
        <div className="relative z-10 text-center max-w-6xl mx-auto px-4">
          <motion.div
            initial={{ opacity: 0, y: 50 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 1, ease: "easeOut" }}
          >
            {/* Animated Title with Holographic Effect */}
            <div className="relative mb-8">
              <motion.h1 
                className="text-7xl md:text-9xl font-bold mb-4 relative"
                initial={{ opacity: 0, scale: 0.5 }}
                animate={{ opacity: 1, scale: 1 }}
                transition={{ duration: 1.2, ease: "easeOut" }}
              >
                <span className="relative inline-block">
                  {['M', 'I', 'B', 'C', 'S'].map((letter, index) => (
                    <motion.span
                      key={letter}
                      className="text-gradient inline-block"
                      initial={{ opacity: 0, y: 50, rotateX: -90 }}
                      animate={{ opacity: 1, y: 0, rotateX: 0 }}
                      transition={{ 
                        duration: 0.8, 
                        delay: index * 0.1,
                        type: "spring",
                        stiffness: 100
                      }}
                      whileHover={{ 
                        scale: 1.1, 
                        textShadow: "0 0 20px #06b6d4",
